import styled from 'styled-components'


const Container = styled.div`
position: relative;
top: 300px;
display: flex;
justify-content: center;
`

const Paragraph = styled.h1`
font-size: 20px;
`

function Home(){
    return(
        <Container>
            <Paragraph>Com o Software de Manutenção da TRACTIAN você está um passo à frente da falha.É mais visibilidade, segurança e controle de forma simples e inteligente, como deve ser.</Paragraph>
        </Container>
    )
}

export default Home;
